import { useState } from "react";
import close from '../Assets/close.png';

function App() {
    return (
        <div className="w-[100vw] h-[100vh] lgncont">
            <div className="w-full h-full loginpage flex justify-center flex-col items-center">
            <div className="w-full h-[5vh] bordertest flex justify-end items-center">
                    <div className="w-[3vw] h-full flex justify-center items-center">
                        <img src={close}></img>
                    </div>
                </div>
                <div className="w-full h-[98vh] bordertest flex justify-center items-center">
                    <div className="w-[27vw] h-[65vh] bordertest logincontainer flex justify-center flex-col items-center gap-[1vw]">
                        <p className="lginheader">Log In</p>
                        <p className="logindesc">Lorem ipsum dolor sit amet.</p>
                        <input id="email" className="w-[18vw] h-[5vh] text-left pl-[1.2vh]" placeholder="Email"></input>
                    </div>
                </div>
            </div>

        </div>
    );
  }
  
export default App;
